import { Pizza } from "models/pizza.model"

type Props = Pizza & {
  handleChangePerson: (data: Pizza) => void;
};

const ItemPizza = ({
  title,
  description,
  handleChangePerson,
}: Props) => {
  return (
    <div>
      <div>{title}</div>
      <div>{description}</div>
    </div>
  )
};

export default ItemPizza;
